	(457, 'ANA', 'أجسام مضادة نوية', 'فحص للكشف عن الأجسام المضادة الذاتية ضد مكونات نواة الخلية، في أمراض المناعة الذاتية', NULL, NULL, 'لا يحتاج صيام'),
	(458, 'Anti-dsDNA', 'أجسام مضادة للـ DNA', 'أجسام مضادة نوعية ضد الحمض النووي DNA، ترتبط بمرض الذئبة الحمراء', NULL, NULL, 'لا يحتاج صيام'),
	(459, 'C3', 'متمم C3', 'قياس مستوى بروتين المتممة C3، جزء من جهاز المناعة، ينخفض في بعض الأمراض', NULL, NULL, 'لا يحتاج صيام'),
	(460, 'C4', 'متمم C4', 'قياس مستوى بروتين المتممة C4، جزء من جهاز المناعة، ينخفض في بعض الأمراض', NULL, NULL, 'لا يحتاج صيام'),
	(461, 'IgA', 'IgA', 'قياس مستوى الغلوبيولين المناعي A، مهم في المناعة المخاطية', NULL, NULL, 'لا يحتاج صيام'),
	(462, 'IgG', 'IgG', 'قياس مستوى الغلوبيولين المناعي G، الأكثر وفرة، يوفر مناعة طويلة المدى', NULL, NULL, 'لا يحتاج صيام'),
	(463, 'IgM', 'IgM', 'قياس مستوى الغلوبيولين المناعي M، أول الأجسام المضادة المنتجة عند العدوى', NULL, NULL, 'لا يحتاج صيام'),
	(464, 'IgE', 'IgE', 'قياس مستوى الغلوبيولين المناعي E، مرتبط بالحساسية والربو والطفيليات', NULL, NULL, 'لا يحتاج صيام'),
	(465, 'Widal test', 'تحليل وايدال', 'فحص للكشف عن الأجسام المضادة لحمى التيفوئيد', NULL, NULL, 'لا يحتاج صيام'),
	(466, 'Weil-Felix', 'ويل فيليكس', 'فحص للكشف عن الأجسام المضادة للحمى النمشية (التيفوس)', NULL, NULL, 'لا يحتاج صيام'),
	(467, 'Brucella', 'بروسيلا', 'فحص للكشف عن الأجسام المضادة لبكتيريا البروسيلا (الحمى المالطية)', NULL, NULL, 'لا يحتاج صيام'),
	(468, 'HIV', 'فيروس نقص المناعة', 'فحص للكشف عن الأجسام المضادة لفيروس نقص المناعة البشرية (الإيدز)', NULL, NULL, 'لا يحتاج صيام، ولكن قد تكون هناك فترة نافذة بعد العدوى'),
	(469, 'HBsAg', 'التهاب كبدي B سطح', 'فحص للكشف عن المستضد السطحي لفيروس التهاب الكبد B، يشير إلى عدوى حالية أو مزمنة', NULL, NULL, 'لا يحتاج صيام'),
	(470, 'HBsAb', 'أجسام مضادة B سطح', 'فحص للكشف عن الأجسام المضادة للمستضد السطحي لفيروس B، يشير إلى مناعة بعد التطعيم أو شفاء من عدوى', NULL, NULL, 'لا يحتاج صيام'),
	(471, 'HBcAb', 'أجسام مضادة B نواة', 'فحص للكشف عن الأجسام المضادة للمستضد النووي لفيروس B، يشير إلى تعرض سابق أو عدوى حالية', NULL, NULL, 'لا يحتاج صيام'),
	(472, 'HCV Ab', 'أجسام مضادة C', 'فحص للكشف عن الأجسام المضادة لفيروس التهاب الكبد C', NULL, NULL, 'لا يحتاج صيام، ولكن قد تكون هناك فترة نافذة بعد العدوى'),
	(473, 'HCV PCR', 'PCR فيروس C', 'فحص جزيئي للكشف عن المادة الوراثية لفيروس التهاب الكبد C مباشرة، يؤكد العدوى النشطة', NULL, NULL, 'لا يحتاج صيام'),
	(474, 'HBV PCR', 'PCR فيروس B', 'فحص جزيئي للكشف عن المادة الوراثية لفيروس التهاب الكبد B مباشرة، يقيس الحمل الفيروسي', NULL, NULL, 'لا يحتاج صيام'),
	(475, 'TB Quantiferon', 'كوانتيفيرون الدرن', 'فحص دم للكشف عن عدوى السل الكامنة عن طريق قياس استجابة الخلايا التائية', NULL, NULL, 'لا يحتاج صيام'),
	(476, 'ASO titer', 'ASO Titer', 'قياس كمية الأجسام المضادة لمضاد الستربتوليزين O، لتشخيص عدوى المكورات العقدية السابقة', NULL, NULL, 'لا يحتاج صيام'),
	(477, 'Beta hCG', 'هرمون الحمل', 'فحص للكشف عن هرمون الحمل (موجهة الغدد التناسلية المشيمائية)، لتشخيص الحمل وبعض الأورام', NULL, NULL, 'لا يحتاج صيام، يستخدم عينة بول أو دم'),
	(478, 'Semen analysis', 'تحليل السائل المنوي', 'فحص خصائص السائل المنوي (العدد، الحركة، الشكل) لتقييم الخصوبة', NULL, NULL, 'امتناع عن القذف لمدة 2-5 أيام قبل جمع العينة، جمع العينة في عبوة معقمة، نقلها للمعمل خلال ساعة'),
	(479, 'AMH', 'مخزون المبيض', 'قياس هرمون مضاد مولر لتقييم مخزون البويضات واحتياطي المبيض', NULL, NULL, 'لا يحتاج صيام، يمكن سحب العينة في أي يوم من الدورة الشهرية'),
	(480, 'Rubella IgG/IgM', 'حصبة ألمانية IgG/IgM', 'فحص الأجسام المضادة للحصبة الألمانية لتقييم المناعة قبل الحمل أو تشخيص عدوى حديثة', NULL, NULL, 'لا يحتاج صيام'),
	(481, 'Toxoplasma IgG/IgM', 'توكسوبلازما IgG/IgM', 'فحص الأجسام المضادة للتوكسوبلازما لتقييم المناعة قبل الحمل أو تشخيص عدوى حديثة', NULL, NULL, 'لا يحتاج صيام'),
	(482, 'CMV IgG/IgM', 'CMV IgG/IgM', 'فحص الأجسام المضادة لفيروس مضخم الخلايا لتقييم المناعة قبل الحمل أو تشخيص عدوى حديثة', NULL, NULL, 'لا يحتاج صيام'),
	(483, 'Amylase', 'أميليز', 'إنزيم يفرز من البنكرياس والغدد اللعابية، يرتفع في التهاب البنكرياس', NULL, NULL, 'لا يحتاج صيام'),
	(484, 'Lipase', 'ليباز', 'إنزيم يفرز من البنكرياس، أكثر نوعية لالتهاب البنكرياس من الأميليز', NULL, NULL, 'لا يحتاج صيام'),
	(485, 'CK', 'كرياتين كيناز', 'إنزيم موجود في العضلات والقلب والدماغ، يرتفع عند إصابة هذه الأنسجة', NULL, NULL, 'تجنب المجهود العضلي الشديد قبل الفحص بـ 48-72 ساعة'),
	(486, 'CK-MB', 'CK-MB', 'نوع من إنزيم كرياتين كيناز يوجد بشكل رئيسي في عضلة القلب، مؤشر لنوبة قلبية', NULL, NULL, 'تجنب المجهود العضلي الشديد قبل الفحص'),
	(487, 'LDH', 'LDH', 'إنزيم موجود في معظم خلايا الجسم، يرتفع عند تلف الأنسجة (قلب، كبد، رئة، خلايا دم)', NULL, NULL, 'لا يحتاج صيام'),
	(488, 'Ferritin', 'فيريتين', 'بروتين يخزن الحديد داخل الخلايا، مؤشر لمخزون الحديد في الجسم', NULL, NULL, 'صيام 10-12 ساعة');
